import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
import Home from './pages/Home';
import {BrowserRouter,Routes,Route} from "react-router-dom";

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <div>
                <Header/>
                <Routes>
                    <Route path='/' element={<Home />}/>
                </Routes>
                </div>
            </BrowserRouter>

            <Footer/>
        </div>
    );
    }

export default App;
